import React from "react";
import { Link } from "react-router-dom";

const DeleteTaskButton = () => {
  return (
    <React.Fragment>
      <Link to="/addProject" className="btn btn-danger ml-4">
        Delete
      </Link>
    </React.Fragment>
  );
};

export default DeleteTaskButton;
